import React from "react";
import {Link} from "react-router-dom";
import "./css/Navigation.css"

const Nav = ({loggedUser}) => {

    
  return (
      <nav className="navbar">
          
              { loggedUser && <div className="links">
              <a><Link to="/" style={{marginLeft: "0px"}}>Strona główna</Link></a>
              <a><Link to="/bpl">Premier League</Link></a>
              <a><Link to="laliga">La Liga</Link></a>
              <a><Link to="bundesliga">Bundesliga</Link></a>
              <a><Link to="ligue1">Ligue 1</Link></a>
              <a><Link to="allteams" >All teams</Link></a>
              <a><Link to="twitter" >Twitter news</Link></a>
               {loggedUser && loggedUser.roles[0] === "ROLE_USER" &&  <a><Link to="adminpanel">Admin panel</Link></a>}
              </div>
            }
              {!loggedUser && <div className="links">
              <a><Link to="login"> Log in to see navigation bar</Link></a>
                  </div>}
          
      </nav>
  )

}

export default Nav;
